<template>    <div>      <popup        v-model="showValue"        class="vux-popup-picker"        :popup-style="popupStyle">        <div class="vux-popup-picker-container">          <div class="vux-popup-picker-header" @touchmove.prevent>          </div>          <picker            :data="dataList"            v-model="tempValue"          ></picker>        </div>      </popup>    </div></template><script>    import {Picker,Popup} from 'vux'    export default{        name:'SelectPopup',        data(){            return{                fixedColumns:1,                chooseValue:[]            }        },        props: {            showValue:{                type:Boolean,                default:false            },            popupStyle: {                type: Object            },            dataList:{                type:Array            },            tempValue:{                type:Array            }        },        components:{            Popup,            Picker        },        method:{            onPopupHide(){            },            onPopupShow(){            },            onPickerChange(){            }        }    }</script>